import { useNavigate } from "react-router-dom";
import { useEffect, useContext } from "react";
import { Navbar } from "../Layout/Navbar";
import { Map } from "../Layout/Caroucel";
import Button from "react-bootstrap/esm/Button";
import { PostContext } from "../Protectedroute/PostContext";
import { getPosts } from "./postBehavior";
export const Dashboard = () => {
  // const {
  //   postState: { posts, postsLoading },
  //   getPosts,
  // } = useContext(PostContext);

  let nav = useNavigate();

  const getallPost = async () => {
    try {
      const GetallPostzx = await getPosts();
      console.log("GetallPost", await getPosts());
    } catch (error) {
      console.log(error);
    }
  };
  const header = `Authorization: Bearer ${lo}`;
  useEffect(() => {
    if (localStorage.getItem("token") === null) {
      return nav("/login");
    }
    // getPosts();
  });
  return (
    <>
      <Navbar></Navbar>
      <Map></Map>
      <div className="managePost">
        <span className="managePost-title">
          <Button
            type="button"
            class="btn btn-primary"
            data-bs-toggle="modal"
            data-bs-target="#staticBackdrop"
          >
            Add post
          </Button>
        </span>
        <div
          class="modal fade"
          id="staticBackdrop"
          data-bs-backdrop="static"
          data-bs-keyboard="false"
          tabindex={-1}
          aria-labelledby="staticBackdropLabel"
          aria-hidden="true"
        >
          <div class="modal-dialog">
            <div class="modal-content">
              <div class="modal-header">
                <h5 class="modal-title" id="staticBackdropLabel">
                  Modal title
                </h5>
                <button
                  type="button"
                  class="btn-close"
                  data-bs-dismiss="modal"
                  aria-label="Close"
                ></button>
              </div>
              <div class="modal-body">...</div>
              <div class="modal-footer">
                <button
                  type="button"
                  class="btn btn-secondary"
                  data-bs-dismiss="modal"
                >
                  Close
                </button>
                <button type="button" class="btn btn-primary">
                  Understood
                </button>
              </div>
            </div>
          </div>
        </div>
        <div className="managePost-body">
          <ul className="body-Listitem">
            <li className="body-item">item 1</li>
            <li className="body-item">item 2</li>
            <li className="body-item">item 3</li>
            <li className="body-item">item 3</li>
            <li className="body-item">item 3</li>
            <li className="body-item">item 3</li>
            <li className="body-item">item 3</li>
          </ul>
        </div>
      </div>
    </>
  );
};
